class AddEmployeePrameter {  AddEmployeePrameter({    this.id,    this.freeLancerInfoId,    this.projectId,    this.shiftId,    this.weekDays,    this.paymentPeriodTypeId,    this.fromDay,    this.toDay,    this.companyId,    this.employeeStatusId,    this.opportunityValue,    this.bodyMass,    this.licenseExpiryDate,    this.weight,    this.height,  });  AddEmployeePrameter.fromJson(dynamic json) {    id = json['id'];    companyId = json['companyId'];    weight = json['weight'];    freeLancerInfoId = json['freeLancerInfoId'];    projectId = json['projectId'];    shiftId = json['shiftId'];    licenseExpiryDate = json['licenseExpiryDate'];    opportunityValue = json['opportunityValue'];    weekDays = json['weekDays'] != null ? json['weekDays'].cast<String>() : [];    paymentPeriodTypeId = json['paymentPeriodTypeId'];    fromDay = json['fromDay'];    toDay = json['toDay'];    height = json['height'];    employeeStatusId = json['employeeStatusId'];    bodyMass = json['bodyMass'];  }  int? id;  int? freeLancerInfoId;  int? projectId;  int? shiftId;  num? weight;  int? companyId;  num? bodyMass;  num? height;  String?licenseExpiryDate;  num? opportunityValue;  List<int>? weekDays;  int? paymentPeriodTypeId;  int? fromDay;  int? toDay;  int? employeeStatusId;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['freeLancerInfoId'] = freeLancerInfoId;    map['projectId'] = projectId;    map['shiftId'] = shiftId;    map['weight'] = weight;    map['weekDays'] = weekDays;    map['height'] = height;    map['companyId'] = companyId;    map['bodyMass'] = bodyMass;    map['opportunityValue'] = opportunityValue;    map['paymentPeriodTypeId'] = paymentPeriodTypeId;    map['fromDay'] = fromDay;    map['toDay'] = toDay;    map['employeeStatusId'] = employeeStatusId;    map['licenseExpiryDate'] = licenseExpiryDate;    return map;  }}